// HasDatabases applies the HasEdge predicate on the "databases" edge.
func HasDatabases() predicate.BronzeGCPSpannerInstance {
	return predicate.BronzeGCPSpannerInstance(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, DatabasesTable, DatabasesColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPSpannerDatabase
		step.Edge.Schema = schemaConfig.BronzeGCPSpannerDatabase
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasDatabasesWith applies the HasEdge predicate on the "databases" edge with a given conditions (other predicates).
func HasDatabasesWith(preds ...predicate.BronzeGCPSpannerDatabase) predicate.BronzeGCPSpannerInstance {
	return predicate.BronzeGCPSpannerInstance(func(s *sql.Selector) {
		step := newDatabasesStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPSpannerDatabase
		step.Edge.Schema = schemaConfig.BronzeGCPSpannerDatabase
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

